//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void Plugin2AudioProcessorEditor::sliderValueChanged(Slider* sliderThatWasMoved)
{

	if (sliderThatWasMoved == knob1) {
		tune = knob1->getValue();
		double voltage = tune / 127.0; // keep between 0 to 1V
		dacValue = roundDoubleToInt(voltage / vref * 255.0); // map to dac value 0 to round(25.5)
		dacLetter = 'b';
	}
	else if (sliderThatWasMoved == knob2) {
		shape = knob2->getValue();
		dacValue = roundDoubleToInt(shape / 127.0 * 255.0);
		dacLetter = 'f';
	}
	else if (sliderThatWasMoved == knob3) {
		volume = knob3->getValue();
		dacValue = roundDoubleToInt(volume / 127.0 * 255.0);
		dacLetter = 'e';
	}
	else if (sliderThatWasMoved == slider1) {
		attack = slider1->getValue();
		dacValue = roundDoubleToInt(attack / 127.0 * 255.0);
		dacLetter = 'c';
	}
	else if (sliderThatWasMoved == slider2) {
		release = slider2->getValue();
		dacValue = roundDoubleToInt(release / 127.0 * 255.0);
		dacLetter = 'd';
	}


	if (processor.synth == 'x') {
		vout = dacValue / 256.0f * 3.3f;
	}
	else {
		vout = dacValue / 256.0f * 2.3f;
		// do changes here for internal synth calibration once they're ready
	}

	processor.errormsg = "vout: " + String(vout, 3) + "V";
	processor.sendSerialMsg(dacLetter, dacValue);
	label->setText(processor.errormsg, dontSendNotification);

}




